// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;


contract StoreMedicine {
    struct Medicine {
        uint256 nationalId;
        string name;
        string img;
    }

    mapping(uint256 => Medicine) public medicines;
    uint256 public medicineCount = 0;

    event MedicineNameAdded(uint256 id, uint256 nationalId, string name);
    event MedicineImgAdded(uint256 id, uint256 nationalId, string img);

    function addMedicineName(uint256 _nationalId, string memory _name) public {
        medicineCount++;
        medicines[medicineCount] = Medicine(_nationalId, _name, "");
        emit MedicineNameAdded(medicineCount, _nationalId, _name);
    }

    function addMedicineImg(uint256 _nationalId, string memory _img) public {
        medicineCount++;
        medicines[medicineCount] = Medicine(_nationalId, "", _img);
        emit MedicineImgAdded(medicineCount, _nationalId, _img);
    }

    function getMedicine(uint256 _id)
        public
        view
        returns (uint256, string memory, string memory)
    {
        require(_id > 0 && _id <= medicineCount, "Invalid medicine ID");
        Medicine memory medicine = medicines[_id];
        return (medicine.nationalId, medicine.name, medicine.img);
    }
}
